data = json.loads(data_json)

# Extract winners' data
winners_data = []
for race in data:
    for runner in race['runners']:
        if runner['isWinner']:
            winners_data.append(runner['racingStattoData'])
            break

total_winners = len(winners_data)
print(f"Total winners analyzed: {total_winners}")

# Analyze rank
rank_counts = Counter(w['rank'] for w in winners_data)
print("\nRank frequencies for winners:")
for r in sorted(rank_counts.keys()):
    count = rank_counts[r]
    pct = (count / total_winners) * 100
    print(f"Rank {r}: {count} ({pct:.1f}%)")

# Cumulative for rank <= X
print("\nCumulative rank <= X:")
for x in range(1, max(rank_counts.keys()) + 1):
    count = sum(rank_counts[r] for r in rank_counts if r <= x)
    pct = (count / total_winners) * 100
